Предприятие EXPRESS PIZZA приглашает в свою команду оператора call-центра (логиста)
Обязанности:
~работа в call-центре;
~прием входящих звонков и исходящие звонки клиенту;
~обработка заказа;
~взаимодействие с водителем-курьером (составление оптимальных маршрутов, проверка доставки заказа клиенту);
~ведение отчетности.

Требования:
~знание города;
~опыт работы в call-центре (желательно в такси или логистике);
~наличие санитарной книжки;
~уверенное владение ПК;
~исполнительность, аккуратность, умение работать в команде.

Условия:
~почасовая оплата труда (30 000-35 000 бел руб в час);
~дружный коллектив;
~официальное трудоустройство;
~соц. пакет;
~питание;
~развоз по домам;
~график работы 2/2; рабочее место пр. Партизанский либо Рафиева.

