~Выкладка товара;
~Работа с кассой, программой учета товара и сайтом;
~Поддержание чистоты и порядка в магазине;
~Выполнение плана продаж;

Условия:
~Заработная плата = оклад + бонус;
~Оформление по ТК;
~Большие скидки на нашу продукцию;
~График 2/2. Продолжительность рабочего дня согласно режиму работы ТЦ;
~Работа в комфортных условиях, ТРЦ "Arena City" .

